import React, { Component } from 'react';
import { Switch,Route,Link } from 'react-router-dom';


class HomePage extends Component 
{
    render() {
        return (
            <div style={{border:"4px solid blue", backgroundColor:"lightblue", width:"400px", height:"400px", textAlign:"Center" }}> 
                <h1>WELLCOME</h1>
                <button onClick={()=>this.props.history.push('/person')}>START</button>
            </div>
        )
    }
}

export default HomePage
